INSERT INTO lddt_app_website VALUES(66,'2025-09-19','https://journals.rgu.ac.uk/','OJS for RGU','lac-ojs-rgu-live.is.ed.ac.uk',NULL,'EMAIL, NAME','HTTPS','Yes','N','LIVE','JISC',NULL,'OJS','Restart apache (restartapache)','lacddt','Richard (r.milne@rgu.ac.uk)',NULL,'"best efforts" (to be updated)',NULL,'DONE',replace(replace('19/09/2024: RB updated. SR updated Tracking.\r\n06/10/2023: I just sent an emaile to Richard with .csr files asking for sign off the cert PAT\r\n\r\n24/10/2022: All done.\r\n19/10/2022: I just sent cert renewal request to ITI team. The same ticket as before. PAT\r\n19/10/2022: I just generated a new (.csr) file and sent to Richard. The new (.csr) and (.key) I uploaded to (libreq) server. For now just waiting for (.cer) files from Richard. PAT\r\n18/10/2022: There is an issue with the cert and key, I get certificate and private key don''t match. I sent an email to Richard for him to check. If the problem will repeat, maybe I should create a new (.csr) file and send to him again?\r\n18/10/2022: I have received both (.cer) files from Richard. I uploaded them to (libreq) and I sent cert renewal request today I221018-0263 PAT\r\n14/10/2022: I sent an email to Richard with attached (.csr) file. Waiting for he get back to me with (.cer) files. Then upload to (libreq) and send a UniDesk request. PAT','\r',char(13)),'\n',char(10)),'129.215.17.169',1,1,NULL,'0','journals.rgu.ac.uk',4,replace(replace('To renew the SSL Certificate, follow:\r\n1. Download (.csr) file from (libreq) server.\r\n2. Send the above (.csr) file to r.milne@rgu.ac.uk. Sample emeil:\r\n--------------\r\nHi Richard,\r\nPlease find attached a new certificate signing request. Please get the signed certificate back to me as soon as you can so we can get it updated.\r\nIn case of any further questions, please let me know.\r\n---------------\r\n3. They will send you back two files (.pem) and (.cer). Download them. I had a problem with downloading the (.cer) file. I think this is a security reason. I asked Scott to manually change extension from (.cer) to (.pem) and it worked.\r\n4. Upload both the files to (libreq) server and send a standard UniDesk call to ITI Team.','\r',char(13)),'\n',char(10)),2,3,NULL,'','',NULL,NULL);
INSERT INTO lddt_app_website VALUES(67,'2024-11-02','https://test-eresearch.qmu.ac.uk/','QMU repository','lac-dspace-qmu-test.is.ed.ac.uk',NULL,NULL,'HTTPS','Yes','N','TEST','JISC',NULL,'DSpace',replace(replace('DSPACE RESTART PROCESS- EXPAND CELL: Stop tomcat (/home/lib/dspace/tomcat/bin/shutdown.sh)\r\n- If the process hasn''t exited within a minute, use ''kill -9 <pid>''\r\n- Restart SQL (sudo service postgresql-9.3 restart)\r\n- Restart Apache (sudo service httpd restart)\r\n- Start tomcat (/home/lib/dspace/tomcat/bin/startup.sh)','\r',char(13)),'\n',char(10)),'dspace','repo-qmu@mlist.is.ed.ac.uk or Garry ghaining@qmu.ac.uk','https://groups.google.com/forum/#!forum/dspace-tech','[test]','20.500.12289','TEST',replace(replace('03/11/2023: Certs received. I just sent cert renewal request to ITI I231103-1232 PAT\r\n02/11/2023: Request for a new .cer file sent to Gary. PAT\r\n\r\n19/09/2023: I just sent an email to Garry:\r\nGood morning Garry\r\nI''m just checking if you will be still available to generate  the Certificate for test-eresearch.qmu.ac.uk and eresearch.qmu.ac.uk this year?\r\nThe both expire on 10/11/2023 but if any chance you can send them to me before that date, it would be great.\r\nThank you very much.\r\n\r\n11/11/2022: All done PAT\r\n\r\n10/11/2022: I received an email from Garry ghaining@qmu.ac.uk with all the .cer attache. Sent request to ITI. PAT\r\n\r\n10/11/2022: No reply from them. I just sent an email to Angela (abrock@qmu.ac.uk):\r\n-----------------\r\nGood morning Angela,\r\n\r\nSorry to contact you directly but I got your contact from Ben Parkes. A few days ago I sent an email to repo-qmu@mlist.is.ed.ac.uk but I still haven''t gotten any reply. It is about the expiry date of the SSL certificates for test-eresearch.qmu.ac.uk and eresearch.qmu.ac.uk. \r\n\r\nSSL Certificates are expiring today so must be renewed immediately. Could you please give me a contact to the person who does this at your end?\r\n\r\n-------------------\r\n\r\n04/11/2022: I sent email to repo-qmu@mlist.is.ed.ac.uk: \r\n-----------------\r\nI am in charge of updating SSL certificates in the absence of Scott Renton. Wanted to know more about the renewal process for test-eresearch.qmu.ac.uk and eresearch.qmu.ac.uk? \r\nIn most cases, we send .csr files and get signed certificates that are updated. However, in this case, I can''t find the .csr file where we keep them all. How was the process in the previous year?\r\n-----------------','\r',char(13)),'\n',char(10)),'129.215.16.153',1,1,NULL,'0','test-eresearch.qmu.ac.uk',4,replace(replace('------------------------------------------------\r\ntest-eresearch.qmu.ac.uk\r\n-------------------------------------------------\r\nSSL Expiry Date: 10-November-2023\r\nUrgency: Higher\r\nSite: test-eresearch.qmu.ac.uk\r\nType: external\r\nServer:  lac-dspace-qmu-test.is.ed.ac.uk\r\nLocation on lacddt@libreq.is.ed.ac.uk:~/certs/test-eresearch.qmu.ac.uk','\r',char(13)),'\n',char(10)),2,3,NULL,'','',NULL,NULL);
