ss for test-eresearch.qmu.ac.uk and eresearch.qmu.ac.uk?\r\nIn most cases, we send .csr files and get signed certificates that are updated. However, in this case, I can''t find the .csr file where we keep them all. How was the process in the previous year?','\r',char(13)),'\n',char(10)),'129.215.16.157',1,1,NULL,'0','eresearch.qmu.ac.uk',4,replace(replace('------------------------------------------------\r\neresearch.qmu.ac.uk\r\n-------------------------------------------------\r\n***NO LOAD BALANCER***\r\nSSL Expiry Date: 10-Nov-2022\r\nUrgency: Higher\r\nSite: eresearch.qmu.ac.uk\r\nType: external\r\nServer: lac-sdlc-qmu-live.is.ed.ac.uk\r\nLocation on lacddt@libreq.is.ed.ac.uk:~/certs/eresearch.qmu.ac.uk\r\n\r\n\r\nPlease can you update the certs (from lacddt@libreq:~/certs/eresearch.qmu.ac.uk) to:\r\n\r\n\r\nlac-sdlc-qmu-live.is.ed.ac.uk\r\n/etc/pki/tls/private/eresearch.qmu.ac.uk.key\r\n/etc/pki/tls/certs','\r',char(13)),'\n',char(10)),2,3,NULL,'','',1,1);
