INSERT INTO lddt_app_website VALUES(200,'2025-07-20','https://omp.uhi.ac.uk/','Open monographs published by the University of the Highlands and Islands.','lac-omp-uhi-live.is.ed.ac.uk',NULL,NULL,NULL,'Yes',NULL,'LIVE',NULL,NULL,NULL,'',NULL,'Scott Connor (scott.connor@uhi.ac.uk)',NULL,NULL,NULL,NULL,replace(replace('09/07/2024: Received and email from Scott saying that Ronan did the cert for it this year.\r\n09/07/2024: I just sent an email to Scott with .csr file and requested for thr .cer files. Pat\r\n\r\n14/10/2022: I received the file and everything is uploaded to the libreq server. I just sent a UniCall I221012-1753 but not sure what is next step. Just waiting for their replay. PAT\r\n14/10/2022: Scott forgot send me the .cer file. Unfortunetly, he finaly sent them to me but I can''t download the .cer from the email. It may be a security reason. I sent him an email, asking if he can change the extensison from .cer to .pem and rensend it to me. PAT\r\n14/10/2022: I just sent reminder to Scott if there are any news about the certificates. PAT\r\n06/10/2022: I sent the .csr file to Scott. Waiting for his response. PAT','\r',char(13)),'\n',char(10)),'129.215.41.6',1,1,NULL,NULL,'omp.uhi.ac.uk',4,replace(replace('To renew the SSL Certificate, follow:\r\n1. Download (.csr) file from (libreq) server.\r\n2. Send the above (.csr) file to Scott Connor (scott.connor@uhi.ac.uk). Sample emeil:\r\n--------------\r\nHi Scott,\r\nPlease find attached a new certificate signing request. Please get the signed certificate back to me as soon as you can so we can get it updated.\r\nIn case of any further questions, please let me know.\r\n---------------\r\n3. Scott will send you back two files (.pem) and (.cer). Download them. I had a problem with downloading the (.cer) file. I think this is a security reason. I asked Scott to manually change extension from (.cer) to (.pem) and it worked.\r\n4. Upload both the files from Scott to (libreq) server and send a standard UniDesk call to ITI Team.','\r',char(13)),'\n',char(10)),2,3,NULL,'','',NULL,NULL);
